import React, { useEffect, useState } from "react";

export default function TaskPage({ tasks }) {
  const [data, setData] = useState([]);
  const API_URL = "https://my.api.mockaroo.com/orders.json?key=e49e6840";

  useEffect(() => {
    fetch(API_URL)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setData(data);
      });
  }, [setData]);

  console.log(data);

  function search(rows) {
    return rows.filter(
      (row) =>
        row.firstName.toLowerCase().index(data) > -1 ||
        row.lastName.toLowerCase().index(data) > -1 ||
        row.idNumber.toLowerCase().index(data) > -1 ||
        row.address.toLowerCase().index(data) > -1
    );
  }

  return (
    <div>
      <h1>Package Tracking Viewer</h1>
      {data.map((itemData) => (
        <div key={itemData.id}>{itemData.id}</div>
      ))}
    </div>
  );
}
